function solution_to_df(sol, species_names)
    t = sol.t
    u = reduce(hcat, sol.u)'  # rows = time steps, columns = species
    df = DataFrame(time = t)
    for (i, name) in enumerate(species_names)
        df[!, name] = u[:, i]
    end
    return df
end

